import React from 'react';
import { Provider, useSelector } from 'react-redux';
import { NavigationContainer } from '@react-navigation/native';
import { SafeAreaView, StyleSheet, View } from 'react-native';
import DailyList from '@/components/DailyList';
import theme from '@/stores/theme';
import { combineReducers, createStore } from 'redux';
import dayjs from 'dayjs';
import { DailyListProps } from '@/utils/data';

const rootReducer = combineReducers({
  theme,
});
export type AppState = ReturnType<typeof rootReducer>;
const store = createStore(rootReducer);

export default function App() {
  const theme = useSelector((state:AppState) => state);
  const {mode_name, content, text} = theme;
  return (
    <Provider store={store}>
      <NavigationContainer>
        <SafeAreaView style={styles.container}>
            <DailyList {...dailylist_dummy}/>
            <View style={{flex: 5}}/>
        </SafeAreaView>
      </NavigationContainer>
    </Provider>
  );
}

const styles = theme => StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: theme.mainBackgro,
    alignItems: 'center',
    justifyContent: 'center',
  },
});

const dailylist_dummy:DailyListProps = {
  start: dayjs().subtract(3, 'days'),
  end: dayjs().add(3, 'days'),
  events:[
      {
          dateof: 1,
          title: "런닝머신 30분",
          abb: "런닝머신",
          content: "9km/h 5분 12km/h 5분 반복",
          icon: "running",
          date: dayjs(),
          completed: false,
          color: "#ffc8c8"
      },
      {
          dateof: 1,
          title: "영단어 100개 암기",
          content: "TOEIC 영단어 1~100",
          abb: "영단어",
          icon: "study",
          date: dayjs(),
          completed: false,
          color: "#bbbbff"
      },
      {
          dateof: 2,
          title: "영단어 100개 암기",
          content: "TOEIC 영단어 101~200",
          abb: "영단어",
          icon: "study",
          date: dayjs().add(1, 'days'),
          completed: false,
          color: "#bbbbff"
      },
      {
          dateof: 3,
          title: "영단어 100개 암기",
          content: "TOEIC 영단어 201~300",
          abb: "영단어",
          icon: "study",
          date: dayjs().add(2, 'days'),
          completed: false,
          color: "#bbbbff"
      },
  ]
}
